import React from "react";
import "./IntroductionPage.css";
import Navbar from "../Navbar/Navbar";
import videocall from '../IMGS/videocall.jpeg';

const IntoductionPage = () => {
  return (
    <div>
      <div>
        <Navbar />
        <div className="one"></div>
        <div className="two">
            <div className="title">
                <h1> What is Call App</h1>
                <p>The Language Learning app where you communicate with others</p> 
            </div>
            <div className="slidetitle">
                <p>Chat</p> 
                <p>Audio</p> 
                <p>Video</p>
            </div>
            <div className="show">
                <img src={videocall} alt="Girl in a jacket" width="800" height="400"></img>
            </div>
            
        </div>
        <div className="three"></div>
        <div className="four"></div>
        <div className="five"></div>
      </div>
    </div>
  );
};

export default IntoductionPage;
